import ElRow from 'element-ui/packages/row/src/row';
import dimensionPage from "../atom/dimension/index";
import { getGenInd } from '@/api/indicators/indAtomInfo';
import { getDimInfos } from '@/api/indicators/indDimInfo';
import { getDimValuesChildren } from '@/api/indicators/indDimValue';
export default {
  components: {
    ElRow: ElRow,
    dimensionPage: dimensionPage
  },
  bizCode: 'bizCode',
  dicts: ['IE_PROP', 'CREATE_TABLE', 'YN', 'RETENTION', 'IE_STATUS', 'GEN_IND', 'IND_FIRST_TYPE', 'IND_SECOND_TYPE', 'BUSSINESS_DEPT', 'IND_LEVEL', 'IND_CURRENCY', 'IND_VALUE_TYPE', 'IND_FREQUENCY', 'IND_CAL_TYPE', 'IND_SAFE_LEVEL', 'IND_MON_FIELD', 'IND_PROCESS_SYS', 'IND_DATA_TYPE', 'IND_STAND_SOURCE', 'DIMENSION_CLASSIFICATION', 'DIMENSION', 'LAST_LEVEL_DIMENSION_VALUE'],
  data: function data() {
    return {
      atomDimensions: [],
      dimensions: [],
      sourceData: [],
      form: {},
      loading: false,
      atomPageDialog: false,
      title: '',

      /* ieCode: '',*/

      /* tag: {
      data: []
      },*/

      /* ieCode:{
      ieCode
      },*/
      userIds: [],
      defaultProps: {
        children: 'children',
        label: 'label'
      },
      dimensionArr: [],
      dimensionTitle: '维度',
      dimensionNumber: 2,
      dimensionTmp: null,
      dimensionValueArr: [],
      dimensionValueTitle: '维度值',
      dimensionValueNumber: 2,
      dimensionValueTmp: null,
      indInnerWarnValueArr: [1],
      indInnerWarnValueNumber: 1,
      indInnerWarnPassValueArr: [1],
      indInnerWarnPassValueNumber: 1,
      indMonWarnValueArr: [1],
      indMonWarnValueNumber: 1,
      indMonWarnPassValueArr: [1],
      indMonWarnPassValueNumber: 1,
      genIndArr: [],
      dimInfoArr: [],
      dimValueArr: [],
      dimAndValueObject1: {
        dimension: null,
        dimensionValue: null
      },
      dimAndValueObject2: {
        dimension: null,
        dimensionValue: null
      }
    };
  },
  computed: {},
  created: function created() {
    var _this = this;

    getGenInd().then(function (data) {
      _this.genIndArr = data.data;
    });
    getDimInfos({
      size: 100,
      page: 0
    }).then(function (data) {
      _this.dimInfoArr = data.data.records;
    });
    getDimValuesChildren({
      size: 100,
      page: 0
    }).then(function (data) {
      _this.dimValueArr = data.data;
    });
  },
  methods: {
    atomDimensionHandle: function atomDimensionHandle() {
      var _thisDim = this.$refs.dimensionPage;
      _thisDim.dimensionDialog = true;
      _thisDim.atomDimensions = this.atomDimensions;
      _thisDim.dimensions = this.dimensions;
      _thisDim.dimDisplay = 'none';
    }
  }
};
